query BlogPostQuery(
  $slug: String!
) {
  markdownRemark(frontmatter: {slug: {eq: $slug}}) {
    html
    frontmatter {
      date
      slug
      title
    }
  }
}

query BlogIndexQuery {
  allMarkdownRemark(sort: {fields: frontmatter___date, order: DESC}) {
    edges {
      node {
        id
        frontmatter {
          title
          date
          slug
        }
        excerpt(pruneLength: 300)
      }
    }
  }
}

query SiteMetadata {
  site {
    siteMetadata {
      title
      description
    }
  }
}
